AppStore.FullSheet.ExternalPurchases.Body;Any accounts or purchases made outside of this app will be managed by the developer “@@developerName@@.” Your App Store account, stored payment method, and related features, such as subscription management and refund requests, will not be available. Apple is not responsible for the privacy or security of transactions made with this developer.;"ستتم إدارة أي حسابات أو عمليات شراء تتم خارج هذا التطبيق بواسطة المطوّر ""@@developerName@@"" لن يتوفر حساب App Store الخاص بك وطريقة الدفع المحفوظة وأي من الميزات، كإدارة الاشتراك وطلبات استرداد المبلغ. Apple ليست مسؤولة عن خصوصية أو أمان المعاملات التي تتم مع هذا المطوّر.";Quaisquer contas ou compras efetuadas fora deste app serão gerenciadas pelo “@@developerName@@.” A sua conta da App Store, a forma de pagamento vinculada e os recursos relacionados, tais como o gerenciamento da assinatura e solicitações de reembolso, não estarão disponíveis. A Apple não é responsável pela privacidade ou segurança das transações efetuadas com esse desenvolvedor.;任何在此 App 外建立的帳户或購買的項目將由開發者「@@developerName@@」管理。你在 App Store 的帳户、已儲存的付款方式，以及如管理訂閲和要求退款等功能，將無法使用。Apple 並不負責與此開發者交易的私隱或保安。;“@@developerName@@” gestionarà els comptes o les compres que fassis fora d’aquesta app. El teu compte de l’App Store, el mètode de pagament enregistrat i qualsevol altra funció relacionada, com ara la gestió de subscripcions i les sol·licituds de reemborsament, no estaran disponibles. Apple no és responsable ni de la privacitat ni de la seguretat de les transaccions fetes amb aquesta persona o empresa desenvolupadora.;Svim računima ili kupnjama izvedenim izvan ove aplikacije upravljat će developer „@@DeveloperName@@”. Vaš App Store račun, pohranjeni način plaćanja i pridružene značajke, poput upravljanja pretplatama i zahtjeva za povrat, neće biti dostupni. Apple nije odgovoran za privatnost ni sigurnost transakcija izvršenih s ovim developerom.;Všechny účty a nákupy mimo tuto aplikaci bude spravovat vývojářská společnost @@developerName@@. Váš účet v App Storu, uložená platební metoda a související funkce, jako jsou správa předplatného a žádosti o vrácení peněz, nebudou k dispozici. Společnost Apple neodpovídá za soukromí nebo bezpečnost transakcí provedených s touto vývojářskou společností.;Konti og køb, der er oprettet eller foretaget udenfor denne app, administreres af udvikleren “@@developerName@@”. Din App Store‑konto, gemte betalingsmetoder og relaterede funktioner, herunder administration af abonnementer og refunderingsanmodninger, er ikke tilgængelige. Apple er ikke ansvarlig for anonymiteten eller sikkerheden af transaktioner foretaget med denne udvikler.;Alle accounts of aankopen die aangemaakt of gedaan zijn buiten deze app worden beheerd door de ontwikkelaar '@@developerName@@'. Je App Store-account, bewaarde betaalmethode en andere gerelateerde diensten, zoals abonnementsbeheer en restitutieverzoeken zijn niet beschikbaar. Apple is niet verantwoordelijk voor de privacy of beveiliging van transacties met deze ontwikkelaar.;Any accounts or purchases made outside of this app will be managed by the developer “@@developerName@@”. Your App Store account, stored payment method and related features, such as subscription management and refund requests, will not be available. Apple is not responsible for the privacy or security of transactions made with this developer.;Any accounts or purchases made outside of this app will be managed by the developer “@@developerName@@.” Your App Store account, stored payment method, and related features, such as subscription management and refund requests, will not be available. Apple is not responsible for the privacy or security of transactions made with this developer.;Any accounts or purchases made outside of this app will be managed by the developer “@@developerName@@”. Your App Store account, stored payment method and related features, such as subscription management and refund requests, will not be available. Apple is not responsible for the privacy or security of transactions made with this developer.;"Kaikkia ulkoisia ostoja tai tilejä hallinnoi kehittäjä ""@@developerName@@"". App Store -tilisi, tallennetut maksutavat ja muut ominaisuudet, kuten tilausten hallinta ja hyvityspyynnöt eivät ole käytettävissä. Apple ei ole vastuussa tämän kehittäjän kanssa tehtyjen tapahtumien yksityisyydestä tai turvallisuudesta.";Tous les comptes créés et achats effectués hors de cette app seront gérés par le développeur @@developerName@@. Votre compte App Store, votre mode de paiement enregistré, ainsi que les fonctionnalités associées telles que la gestion des abonnements et les demandes de remboursement ne seront pas disponibles. Apple n’est responsable ni de la sécurité, ni de la confidentialité des transactions effectuées avec ce développeur.;Tous les comptes créés et achats effectués hors de cette app seront gérés par le développeur @@developerName@@. Votre compte App Store, votre mode de paiement enregistré, ainsi que les fonctionnalités associées telles que la gestion des abonnements et les demandes de remboursement ne seront pas disponibles. Apple n’est responsable ni de la sécurité, ni de la confidentialité des transactions effectuées avec ce développeur.;Alle Accounts und alle Käufe, die außerhalb dieser App eingerichtet bzw. getätigt werden, werden von Entwickler „@@developerName@@“ verwaltet. Dein App Store-Account, deine gespeicherte Zahlungsmethode und alle damit zusammenhängenden Features, wie das Abonnementsmanagement und die Rückerstattung, werden nicht zur Verfügung stehen. Apple ist weder für den Datenschutz noch für die Sicherheit von Transaktionen verantwortlich, die mit diesem Entwickler stattfinden.;Ο προγραμματιστής «@@developerName@@» θα διαχειρίζεται τις αγορές και τους λογαριασμούς που δημιουργούνται εκτός αυτής της εφαρμογής. Ο λογαριασμός του App Store, οι αποθηκευμένοι τρόποι πληρωμής και σχετικές δυνατότητες, όπως η διαχείριση συνδρομών και τα αιτήματα επιστροφής χρημάτων, δεν θα είναι διαθέσιμες. Η Apple δεν είναι υπεύθυνη για το απόρρητο ή την ασφάλεια των συναλλαγών που πραγματοποιούνται με αυτόν τον προγραμματιστή.;חשבונות או רכישות שנעשו מחוץ ליישום ינוהלו על ידי המפתח “@@developerName@@”. החשבון שלך ב-App Store, אמצעי התשלום בחנות ותכונות נוספות כגון ניהול המינוי ובקשת החזר כספי לא יהיו זמינים. Apple לא תהיה אחראית לפרטיות או לאבטחה של עסקאות שנעשו עם המפתח הזה.;इस ऐप के बाहर बनाए गए या संचालित किसी भी खाते या की गई किसी भी ख़रीदारी का प्रबंधन डेवलपर “@@developerName@@” द्वारा होगा। आपका App Store खाता, खाते से संबद्ध भुगतान विधि, और इससे जुड़े फ़ीचर, जैसे सब्सक्रिप्शन प्रबंधन और रीफ़ंड अनुरोध, उपलब्ध नहीं होंगे। इस डेवलपर के साथ किए गए किसी भी लेनदेन की गोपनीयता या सुरक्षा के लिए Apple ज़िम्मेदार नहीं है।;Az appon kívül létrehozott fiókokat és az appon kívüli vásárlásokat a(z) „@@developerName@@” nevű fejlesztő kezeli. Az App Store-fiókja, mentett fizetési módja és a funkciók, mint például az előfizetés kezelése és a visszatérítési kérelmek, nem lesznek elérhetőek. Az Apple nem felelős az említett fejlesztővel lebonyolított tranzakciók adatvédelméért vagy biztonságáért.;Semua akun yang dibuat atau pembelian yang dilakukan di luar app ini akan dikelola oleh pengembang “@@developerName@@”. Akun App Store, metode pembayaran yang tersimpan, dan fitur terkait, seperti kelola langganan dan permintaan pengembalian dana, tidak akan tersedia. Hanya pembelian melalui App Store yang dijamin aman oleh Apple. Apple tidak bertanggung jawab atas privasi dan keamanan terhadap transaksi yang dibuat dengan pengembang yang bersangkutan.;Account e acquisti esterni a quest’app saranno gestiti da “@@developerName@@”. Il tuo account App Store, i tuoi metodi di pagamento e le attività connesse, come la gestione degli abbonamenti e le richieste di rimborso, non saranno disponibili. Apple non è responsabile per la privacy o la sicurezza delle transazioni effettuate con questo sviluppatore.;このAppの外部で作成されたアカウントや購入履歴は、デベロッパの@@developerName@@によって管理されます。App Storeのアカウント、保存されたお支払い方法、およびサブスクリプションの管理や返金のリクエストなど、関連する機能は利用できません。このデベロッパとの取引に関して、Appleはプライバシーとセキュリティを保護することはできません。;이 앱 외부에서 이뤄지는 계정 생성 또는 구입은 ‘@@developerName@@’ 개발자가 관리합니다. App Store 계정, 저장된 지불 방법과 더불어 구독 관리 및 환불 요청 등과 같은 관련 기능을 이용할 수 없게 됩니다. Apple은 이 개발자와 직접 이뤄진 거래에 있어서 개인 정보 보호 또는 안전에 대한 책임을 지지 않습니다.;Sebarang akaun atau pembelian yang dibuat di luar app ini akan diurus oleh pembangun “@@developerName@@”. Akaun App Store anda, kaedah bayaran yang disimpan dan ciri berkaitan, seperti pengurusan langganan dan permintaan bayar balik, tidak akan tersedia. Apple tidak bertanggungjawab atas privasi atau keselamatan transaksi yang dibuat dengan pembangun ini.;Kontoer og kjøp utenfor denne appen kommer til å håndteres av “@@developerName@@”. Din App Store-konto, lagrede betalingsmåter og andre funksjoner, som for eksempel administrasjon av abonnementer og refunderinger, kommer ikke til å være tilgjengelige. Apple er ikke ansvarlig for personvern eller sikkerhet ved transaksjoner med denne utvikleren.;Wszystkie utworzone konta i zakupy dokonane po opuszczeniu tej aplikacji będą obsługiwane przez „@@developerName@@”. Twoje konto, przechowywane metody płatności i inne funkcje powiązane z App Store, takie jak zarządzanie subskrypcjami i prośby o zwrot, nie będą dostępne. Apple nie odpowiada za prywatność ani bezpieczeństwo transakcji dokonanych z tym deweloperem.;Quaisquer contas ou compras efetuadas fora desta app serão geridas pelo programador @@developerName@@. A sua conta da App Store, o método de pagamento armazenado e as funcionalidades relacionadas, tais como a gestão de assinaturas e os pedidos de reembolso, não estarão disponíveis. A Apple não é responsável pela privacidade e segurança das transações efetuadas com este programador.;Orice conturi sau achiziții efectuate în afara acestei aplicații vor fi gestionate de dezvoltatorul @@developerName@@. Contul dvs. App Store, metoda de plată înregistrată și alte funcționalități asociate, precum gestionarea abonamentelor și solicitările de rambursare nu vor fi disponibile. Apple nu este responsabil pentru confidențialitatea sau securitatea tranzacțiilor efectuate cu acest dezvoltator.;Аккаунты и покупки, совершенные вне этого приложения, управляются разработчиком «@@developerName@@». Ваш аккаунт App Store, выбранный способ оплаты и связанные возможности, такие как управление подписками и запрос на возврат денежных средств, будут недоступны. Apple не несет ответственности за безопасность или конфиденциальность транзакций, совершенных на внешних ресурсах разработчика.;任何在此 App 外建立的帐户或进行的购买将由开发者“@@developerName@@”管理。您的 App Store 帐户、储存的付款方式及相关功能（如订阅项目管理和退款请求）将不可用。与该开发者进行交易的隐私或安全，Apple 概不负责。;Účty alebo nákupy zrealizované mimo tejto aplikácie budú spravované vývojárskou spoločnosťou @@developerName@@. Váš účet v App Store, uložený spôsob platby a ďalšie funkcie ako správa predplatného a žiadosti o vrátenie peňazí nebudú dostupné. Spoločnosť Apple nezodpovedá za ochranu súkromia alebo bezpečnosť transakcií medzi vami a touto vývojárskou spoločnosťou.;Las cuentas o compras hechas fuera de esta app serán administradas por el desarrollador “@@developerName@@”. Tu cuenta de App Store, el método de pago guardado y las prestaciones relacionadas con esta cuenta, tales como la administración de suscripciones y los solicitudes de reembolso, no estarán disponibles. Apple no es responsable de la privacidad ni la seguridad de las transacciones realizadas con este desarrollador.;Las cuentas o las compras no hechas en esta app serán administradas por el desarrollador “@@developerName@@”. Tu cuenta de App Store, la forma de pago que has configurado y las características relacionadas, tales como la administración de suscripciones y los pedidos de reembolso, no estarán disponibles. Apple no será responsable por la privacidad o la seguridad de las transacciones realizadas con este desarrollador.;Konton och köp utanför den här appen kommer att hanteras av “@@developerName@@”. Ditt App Store-konto, sparade betalningsmetoder och andra funktioner, som t.ex. prenumerationshantering och begäranden om återbetalningar kommer inte att vara tillgängliga. Apple ansvarar inte för integriteten eller säkerheten för transaktioner med den här utvecklaren.;การซื้อหรือการสร้างบัญชีที่เกิดขึ้นภายนอกแอปนี้จะได้รับการดูแลโดยนักพัฒนา “@@DeveloperName@@” คุณจะไม่สามารถใช้งานบัญชี App Store ของคุณ รวมถึงข้อมูลการชำระเงินที่ถูกบันทึกอยู่ในระบบและฟีเจอร์ที่เกี่ยวข้อง เช่น การจัดการการสมัครรับและการขอเงินคืนได้ Apple ไม่มีส่วนรับผิดชอบต่อความเป็นส่วนตัวและความปลอดภัยของธุรกรรมที่ทำกับนักพัฒนารายนี้;任何在此 App 外建立的帳號或進行的購買將由開發者「@@developerName@@」管理。您將無法使用您的 App Store 帳號、儲存的付款方式及相關功能（如訂閲管理和退款要求等）。與此開發者交易之隱私或安全，Apple 概不負責。;Bu uygulamanın dışında oluşturduğunuz hesaplar ve yapmış olduğunuz satın alımlar, geliştirici “@@developerName@@” tarafından yönetilecektir. App Store hesabınız ve kaydedilmiş ödeme yönteminizin yanı sıra abonelik yönetimi ve geri ödeme talebi gibi ilgili diğer özellikler de kullanılamayacak. Apple, bu geliştirici ile yapılan işlemlerin gizliliği veya güvenliğinden sorumlu değildir.;Усі облікові записи або покупки, зроблені не в цій програмі, будуть керуватися розробником (@@developerName@@). Ваш обліковий запис App Store, збережений спосіб оплати та пов’язані з ним функції, такі як керування передплатами та запити на повернення коштів, будуть недоступні. Apple не несе відповідальності за конфіденційність чи безпеку транзакцій, здійснених з цим розробником.;Tất cả tài khoản hoặc mục mua ngoài ứng dụng này sẽ được nhà phát triển “@@developerName@@” quản lý. Tài khoản App Store, phương thức thanh toán được lưu và các tính năng liên quan như là quản lý đăng ký và yêu cầu hoàn tiền sẽ không khả dụng. Apple không chịu trách nhiệm cho sự riêng tư hoặc bảo mật cho các giao dịch với nhà phát triển này.
