AppStore.FullSheet.ExternalPurchases.Title;You’re about to leave the app and go to an external website. You will no longer be transacting with Apple.;أنت على وشك مغادرة التطبيق والانتقال إلى موقع ويب خارجي. تنتهي المعاملة المالية مع Apple عند هذه النقطة.;Você está prestes a sair do app e acessar um site externo. Portanto, você não estará mais realizando transações com a Apple.;即將離開此 App 並前往外部網站。其後的交易並非與 Apple 進行。;Estàs a punt de sortir de l’app i anar a un lloc web extern. Qualssevol transaccions que fassis a partir d’aquest moment ja no seran amb Apple.;Napuštate aplikaciju i idete na vanjsku web‑stranicu te više nećete imati transakcije s Appleom;Chystáte se opustit aplikaci a přejít na externí web. Se společností Apple již nebudete provádět žádné transakce;Du er ved at forlade appen og vil blive sendt til et eksternt websted. Du vil ikke længere udveksle transaktioner med Apple.;Je staat op het punt om de app te verlaten en naar een externe website te gaan. Je hebt geen transacties meer met Apple.;You’re about to leave the app and go to an external website. You will no longer be transacting with Apple.;You’re about to leave the app and go to an external website. You will no longer be transacting with Apple.;You are about to leave the app and go to an external website. You will no longer be transacting with Apple.;Poistut nyt apista ulkoiselle verkkosivustolle. Apple ei enää käsittele mitään tapahtumia.;Vous êtes sur le point de quitter l’app et d’accéder à un site web externe. Vous ne ferez plus transaction avec Apple.;Vous êtes sur le point de quitter l’app et d’accéder à un site Web externe. Vous ne ferez plus transaction avec Apple.;Du bist dabei, die App zu verlassen und eine externe Webseite anzusteuern. Deine Transaktion findet nicht mehr mit Apple statt.;Πρόκειται να φύγετε από την εφαρμογή και να μεταβείτε σε έναν εξωτερικό ιστότοπο. Οι συναλλαγές σας με την Apple θα διακοπούν.;אתם עומדים לעזוב את היישום ותעברו לאתר חיצוני. העסקה לא מתבצעת יותר עם Apple.;आप यह ऐप छोड़कर एक बाहरी वेबसाइट पर जाने वाले हैं। फिर आप Apple से लेनदेन नहीं कर रहे होंगे।;Az app elhagyására készül egy külső weboldalra lépéssel. A továbbiakban nem az Apple‑lel folytatja a műveletet.;Anda akan keluar dari app dan pergi ke situs web eksternal. Anda tidak akan melakukan transaksi dengan Apple.;Stai per lasciare l’app collegandoti a un sito web esterno. Le transazioni successive non riguardano più Apple.;Appを終了すると、外部のWebサイトに移動します。Appleで決済することはありません。;이 앱에서 나가 외부 웹 사이트로 이동하려 합니다. 거래는 더 이상 Apple과 이뤄지는 것이 아닙니다.;Anda akan meninggalkan app dan pergi ke laman web luaran. Anda tidak akan lagi berurus dengan Apple.;Du forlater nå appen og går til en ekstern nettside. Eventuelle transaksjoner kommer ikke til å håndteres av Apple.;Kontynuując, opuścisz aplikację i przejdziesz na zewnętrzną stronę internetową. Twoja transakcja nie będzie obsługiwana przez Apple;Está prestes a sair da app e a ir para um site externo. Deixará de efetuar transações com a Apple.;Sunteți pe punctul de a părăsi aplicația și a accesa un site extern. Nu veți mai tranzacționa cu Apple.;Вы собираетесь покинуть приложение и перейти на внешний сайт. Транзакции не будут контролироваться Apple.;您即将离开此 App 并前往外部网站。此后的交易并非与 Apple 进行。;Chystáte sa opustiť aplikáciu a prejsť na externú web stránku. Vaša transakcia nebude vybavená cez Apple.;Estás a punto de salir de la app y entrar en un sitio web externo. Tus transacciones ya no serán con Apple.;Estás a punto de salir de la app y entrar a un sitio web externo. Tus transacciones ya no serán con Apple.;Du lämnar nu appen för en extern webbsida. Eventuella transaktioner kommer inte att hanteras av Apple.;คุณกำลังจะออกจากแอปเพื่อไปยังเว็บไซต์อื่น การทำธุรกรรมต่อจากนี้จะไม่เกี่ยวข้องกับ Apple;您即將離開此 App 並前往外部網站。此後的交易並非與 Apple 進行。;Uygulamadan çıkıp başka bir web sitesine gitmek üzeresiniz. Bundan sonra yapacağınız işlemler artık Apple ile olmayacak.;Ви збираєтеся вийти з програми та перейти на зовнішній вебсайт. Ви більше не будете здійснювати транзакції з Apple.;Bạn Sắp Rời Ứng Dụng Để Truy Cập Trang Web Bên Ngoài. Bạn Sẽ Không Còn Giao Dịch Với Apple Nữa.""";

